import { Card, Avatar, Button } from "antd";
import CenteralAppLayout from "./CenteralAppLayout";

const ProfileCard = () => {
  const dummy = {
    pet: {
      name: "wilson",
      breed: "골든 리트리버",
      birth: new Date().toLocaleDateString,
      location: "경기도 성남시 분당구",
      image: "http://www.animaltogether.com/news/photo/201907/167_346_855.jpg",
    },
    owner: { name: "kk" },
  };
  return (
    <CenteralAppLayout>
      <Card
        title={dummy.pet.name}
        actions={[dummy.pet.breed, dummy.pet.birth, dummy.pet.location]}
        cover={<img src={dummy.pet.image} />}
      >
        <Card.Meta
          avatar={<Avatar src={dummy.pet.image} />}
          title={dummy.pet.name}
          description={`귀여운 리트리버 강아지에요`}
        />
      </Card>
    </CenteralAppLayout>
  );
};

export default ProfileCard;
